import React from 'react';

const Login = props => {
    return (
        <form onSubmit={''}>
            <input 
                type="text"
                value={props.username}
                name='username'
                onChange={props.inputChangeHandler}
                placeholder='username'
            />
            <input 
                type="password"
                value={props.password}
                name="password"
                onChange={props.inputChangeHandler}
                placeholder="password"
            />
            <input type="email"/>
            <button onCLick={''}>Sign in</button>
        </form>
    );
}

export default Login;
